import React from 'react';
import { Box, Paper } from '@mui/material';

export default function About() {
   return (
      <Box sx={{
         margin: 6,
      }}>
         <Paper>
            <div>Data was sourced from the Liftie and Skimaps.org APIs.</div>
            <div>This application doesn't list many of the smaller California ski resorts because
               the Liftie API doesn't currently include them.</div>
            <div>A couple of extra caveats:
               <ul>
                  <li>Squaw Valley and Alpine Meadows have merged to form Palisades Tahoe.
                     A new gondole will connect the two resorts.</li>
               </ul>
            </div>
         </Paper>
      </Box>
   );
}
